from collections import Counter

class Solution:
    def wordSubsets(self, A, B):
        """
        :type A: List[str]
        :type B: List[str]
        :rtype: List[str]
        """
        B = set(B)
        B = sorted(B, key=lambda x:len(x), reverse=True)
        B_count = []
        for b in B:
            c_b = Counter(b)
            chr_set = set(b)
            flag = True
            for former_c in B_count:
                if flag == False:
                    break
                if set(former_c) >= chr_set:
                    for chr in chr_set:
                        if c_b[chr] > former_c[chr]:
                            break
                    else:
                        flag = False
            if flag:
                B_count.append(c_b)

        res = []
        for word in A:
            word_c = Counter(word)
            charset_in_word = set(word_c)
            flag = True # can this word append into res
            for subword_c in B_count:
                if flag == False:
                    break
                if set(subword_c) <= charset_in_word:
                    for chr in subword_c:
                        if subword_c[chr] <= word_c[chr]:
                            continue
                        else:
                            flag = False
                else:
                    flag = False
            if flag:
                res.append(word)
        return res
                
